    data: |
      SELECT - ( + 6 ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1

outputs:
  - name: q66.out
    data: |
      -6
      -6
      -6
      -6
      -6
      -6
      -6
      -6
      -6
